%Choice of Areas to Graph (Area Fraction, MAF Size)
c_frac = {georgia_frac};

%For Loop of Areas
for area = 1:length(c_frac(:,1))
    frac = c_frac{area,1};
    clen = length(frac);
    
    %Time (X-Axis) Details
    t_width = clen/14; 
    texp = t_width/(clen-1); 
    t_mc = [0:texp:t_width]; 
    
    %Initial Change in di/dt
    di0 = frac(2) - (1+ps*del)*frac(1);
    
    %Initial Conditions and Creation of Compartment and Function Arrays
    S = zeros(clen,1); E = zeros(clen,1); I = zeros(clen,1); Q = zeros(clen,1); R = zeros(clen,1); C = zeros(clen,1);
    S(1) = 1 - (di0 + (chi+gam)*frac(1))/gam; %susceptible
    E(1) = (di0 + chi*frac(1))/gam;           %exposed
    I(1) = frac(1);                           %infected
    Q(1) = 0;                                 %quarantined
    R(1) = 0;                                 %removed
    C(1) = frac(1);

    k = 1; %k(0)
    index = 1;
    sig_arr = zeros(clen-1,1);
    sig_q_arr = zeros(clen-1,1);
    seiqrs_arr = zeros(3,5);
    k_arr = zeros(clen-1,1);

    for t0 = 0:texp:(t_width - texp)
        minimum = 1;
        tspan = linspace(t0, t0 + 2*texp, 3);
        
        if index > 2
            %Percent change based on previous sigma values
            old = sig_arr(index - 2);
            new = sig_arr(index - 1);
            k = min(k*(new/old),1);
        end

        k_arr(index) = k;

        for sig = 0.05:0.05:25
            %System of Differential (Fractional Compartment) Eqns
            f = @(t,x)[eta*x(5)/beta-sig*(x(3)+k*x(4))*x(1);
                       sig*(x(3)+k*x(4))*x(1) - gam*x(2)/beta;
                       (gam*x(2) - ps*del*x(3))/beta - (1-ps)*x(3);
                       (ps*del*x(3) - eps*x(4))/beta;
                       (1-ps)*x(3) + (eps*x(4) - eta*x(5))/beta;
                       gam*x(2)/beta]; 
            [ta,xa] = ode45(f,tspan,[S(index),E(index),I(index),Q(index),R(index),C(index)]);
            
            %Find Optimized sig(t)
            if minimum < MSELoss(frac(index+1),xa(2,3)+xa(2,4))
                break
            end
            
            minimum = MSELoss(frac(index+1),xa(2,3)+xa(2,4));
            seiqrs_arr = xa;
            sig_arr(index) = sig;
        end
        sig_q_arr(index) = k*sig_arr(index);

        index = index + 1;
        S(index) = seiqrs_arr(2,1); 
        E(index) = seiqrs_arr(2,2); 
        I(index) = seiqrs_arr(2,3);
        Q(index) = seiqrs_arr(2,4); 
        R(index) = seiqrs_arr(2,5);
        C(index) = seiqrs_arr(2,6);
    end
    
    %Graph Smoothing
    sig_arr = smoothdata(sig_arr,'gaussian',20);
    sig_q_arr = smoothdata(sig_q_arr,'gaussian',15);
    k_arr = smoothdata(k_arr,'gaussian',15);
    E = smoothdata(E,'gaussian',15);
    rt_arr = smoothdata((gam*E)./(chi*I),'gaussian'); %smoothdata((gam*E)./(chi*I),'gaussian');
    
    %Fitting Model Details for area
    disp(mean(sig_arr(find(sig_arr < 5, 1, 'first'):end)))

    %Plot Formatting Conditions
    inputs = {'Interpreter','latex','fontsize',20};
    inputs1 = {'Interpreter','latex','fontsize',15};
    %Figure Creation
    figure(1) 
    plot(t_mc,E.','k--','LineWidth',1.5)
    hold on;
    plot(t_mc,I.', 'k','LineWidth',1.5)
    hold on;
    plot(t_mc,Q.','k:','LineWidth',1.5)
    hold on;
    plot(t_mc(1:3:end),c_frac{area,1}(1:3:end), 'k*')
    hold on;
    legend({'$$e_{p} (t)$$', '$$i_{p} (t)$$', '$$q_{p} (t)$$', '$$a_{a}(t)$$'}, inputs{:})
    xlabel('$$t$$',inputs{:}), ylabel('Fraction of Population',inputs{:})
    set(gca,'FontSize', 20,'LineWidth',1.5, 'ticklabelinterpreter', 'latex')
    hold on;
    
    figure(2)
    plot(t_mc(1:end-1),sig_arr,'k','LineWidth',1.5)
    xline(14/14, 'k--','linewidth',1.5)
    xline(32/14, 'k--','linewidth',1.5)
    xline(60/14, 'k--','linewidth',1.5)
    xline(129/14, 'k--','linewidth',1.5)
    xline(169/14, 'k--','linewidth',1.5)
    xlabel('$$t$$',inputs{:}), ylabel('$$\sigma(t)$$',inputs{:})
    set(gca,'FontSize', 20,'LineWidth',1.5, 'ticklabelinterpreter', 'latex')
    hold on;
    
    figure(3)
    plot(t_mc, R, 'k', 'LineWidth', 1.5)
    hold on;
    plot(t_mc, C, 'k--', 'LineWidth',1.5)
    hold on;
    xlabel('$$t$$',inputs{:}), ylabel('Fraction of Population',inputs{:})
    set(gca,'FontSize', 20,'LineWidth',1.5, 'ticklabelinterpreter', 'latex')
    legend({'$$r_{p} (t)$$', '$$c_{p} (t)$$'},inputs{:})
end

